import React from 'react';
import File from './file/File';
import { useSelector } from 'react-redux';
import './fileList.css';
import { Button } from 'react-bootstrap';

const FileList = () => {
    const files = useSelector(state => state.files.files).map(file => <File file={file} key={file.id} />);
    const userId = useSelector(state => state.user.userId);
    const currentDir = useSelector(state => state.files.currentDir);
    return (
        <div className='FileList-container'>
            <div className='FileList-header'>
                {currentDir === null || userId ? <button className='FileList-back' title='Back'>â€¹</button> : ''}
                <span className='FileList-name'>Name</span>
                <span className='FileList-date'>Last modified</span>
                <span className='FileList-size'>File size</span>
            </div>
            {files}
        </div>
    );
};

export default FileList;
